import React from 'react';

const Dashboard = () => {
    return (
        <div className="p-6 bg-purple-100 h-full" style={{'height':'100'}}>
            <h2 className="text-2xl font-bold mb-4">Dashboard</h2>
            <div className="flex justify-between space-x-4 ">
                {/* Rectangle 1 */}
                <div className="w-1/4 h-96 bg-gray-400 rounded-lg shadow-md flex items-center justify-center text-white">
                    <p>Follow Up</p>
                </div>
                
                {/* Rectangle 2 */}
                <div className="w-1/4 h-96 bg-gray-400 rounded-lg shadow-md flex items-center justify-center text-white">
                    <p>Open Tasks</p>
                </div>
                
                {/* Rectangle 3 */}
                <div className="w-1/4 h-96 bg-gray-400 rounded-lg shadow-md flex items-center justify-center text-white">
                    <p>Contact Made</p>
                </div>
                
                {/* Rectangle 4 */}
                <div className="w-1/4 h-96 bg-gray-400 rounded-lg shadow-md flex items-center justify-center text-white">
                    <p>Rejected</p>
                </div>
            </div>
        </div>
    );
};

export default Dashboard;
